import React from 'react'
import CartItem from './CartItem';
import classes from './Cart.module.css'
const Cart = ({products}) => {

  console.log(products);

  return (

  <Modazz className={classes.cart}>  
     {products.map( (product) => 
      <CartItem 
         key={product.id} 
         product={product}>
      </CartItem>)}
    </Modazz>

  )
}

export default Cart
